import { lazy } from 'react'

const PurchaseRoutes = [
  {
    path: '/purchase/purchase-detail',
    component: lazy(() => import('../../views/pages/purchase/Purchase'))
  },
  {
    path: '/purchase/stationary-request',
    component: lazy(() => import('../../views/pages/purchase/StationaryRequest'))
  }
]

export default PurchaseRoutes
